	add("mashout", "{\"term\":\"mashout\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The step or process, in brewing beer, of raising the mash (e.g. by adding hot water to it) to a temperature around 75 °C or 170 °F, so as to stop the enzymatic conversion of starch to fermentable sugar and make the mash and wort more fluid\", \"priority\":1}]}, \"synonyms\":{}}");

	add("mason", "{\"term\":\"mason\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"frankish\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) \u0027masoun\u0027 \u0027machun\u0027 from Anglo-norman \u0027machun\u0027 \u0027masson\u0027 from Old Low Frankish *\u0027\u0027 (mattio) from Proto-germanic {{m|gem-pro|*maitô}} (compare German obsolete \u0027metz\u0027 Stein\u0027steinmetz\u0027 , from {{m|gem-pro|*maitaną||to cut, hew}} (compare Old High German \u0027meizan\u0027 East Frisian \u0027matje\u0027 Old Norse \u0027meita\u0027 , from Proto-indo-european {{m|ine-pro|*mai-d-||to alter}} (compare Old Lithuanian ap\u0027apmaitinti\u0027 Latvian \u0027maitat\u0027 , enlargement of Proto-indo-european {{m|ine-pro|*mei-||to change, exchange}}. More at {{l|en|mean}}, {{l|en|mutate}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One whose occupation is to build with stone or brick; also, one who prepares stone for building purposes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A member of the fraternity of Freemasons. See Freemason\", \"priority\":2}]}, \"synonyms\":{}}");

