	add("masque", "{\"term\":\"masque\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|masque|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"in 16th-17th Century England \u0026amp; Europe)\u0027 A dramatic performance, often performed at court as a royal entertainment, consisting of dancing, dialogue, pantomime and song\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Words and music written for a masque\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A masquerade\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A facial mask\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"mud \u0027\u0027masque\u0027\u0027; clay \u0027\u0027masque\", \"priority\":5}]}, \"synonyms\":{}}");

