	add("masquerade", "{\"term\":\"masquerade\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Spanish\", \"French\", \"Italian\"], \"text\":\"From French \u0027mascarade\u0027 (Spanish \u0027mascarada\u0027), from Italian \u0027mascarata\u0027 (\u0027mascherata\u0027). See “mask”.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A party or assembly of people wearing masks, and amusing themselves with dancing, conversation, or other diversions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"In courtly balls and midnight \u0027\u0027masquerades\u0027\u0027 - w:Alexander Alexander Pop\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A dramatic performance by actors in masks; a mask. See “mask\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Acting or living under false pretenses; concealment of something by a false or unreal show; pretentious show; disguise\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I was invited to the \u0027\u0027masquerade\u0027\u0027 at their home\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"That \u0027\u0027masquerade\u0027\u0027 of misrepresentation which invariably accompanied the political eloquence of Rome - w:Thomas de Thomas de Quince\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A Spanish entertainment in which squadrons of horses charge at each other, the riders fighting with bucklers and canes\", \"priority\":7}]}, \"synonyms\":{}}");

