	add("massachusetts", "{\"term\":\"massachusetts\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"wampanoag\"], \"text\":\"The state is named after the tribe. The tribe is named after the {{w|Great Blue Hill}} they resided near. Compare Wampanoag \u0027\u0027 (mishe, missi, mass-) \u0027\u0027 (wadchu, -adchu) \u0027\u0027 (-et)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Capital: Boston\", \"priority\":1}]}, \"synonyms\":{}}");

	add("massachusettsian", "{\"term\":\"massachusettsian\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"* {{suffix|Massachusetts|ian|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A native or resident of Massachusetts\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That he was a Virginian and I a \u0027\u0027Massachusettsian\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A young \u0027\u0027Massachusettsian\u0027\u0027 (is this correct orthography?), by name Nathaniel II. Bishop, a mere lad of seventeen, who, prompted by a love of nature, starts off from his New England home, reaches the La Plata River, and coolly \u0026quot;walks\u0026quot; to Valparaiso, across pampa and cordillera, a distance of more than a thousand miles\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Chadwick (54), though a \u0027\u0027Massachusettsian\u0027\u0027 by birth, residence, and position is not so by preordination. He has a directness of thought, a humour, and a power of seeing himself as others see him that smack more of London or Paris than of Boston\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Much to the chagrin of many a \u0027\u0027Massachusettsian\u0027\u0027, on January 29, 1 842, Secretary of State Daniel Webster dispatched directions to the US ambassador to Great Britain in support of Calhoun\u0027s resolutions\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The minor appointments were the Virginian Edmund Randolph as attorney general and the \u0027\u0027Massachusettsian\u0027\u0027 Henry Knox as secretary of war\", \"priority\":6}]}, \"synonyms\":{}}");

	add("massacre", "{\"term\":\"massacre\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"middle low german\", \"old high german (ca. 750-1050)\", \"gothic\", \"Dutch\"], \"text\":\"1580, from Middle french (ca. 1400-1600) {{m|frm|massacre}}, from Old french (842-ca. 1400) {{m|fro|macacre|macacre, macecle|slaughterhouse, butchery}}, from {{m|en|mazacrium||massacre, slaughter, killing”, also “the head of a newly killed stag}}, from Middle low german {{m|gml|*matskelen||to massacre}} (compare German {{m|de|metzeln||massacre}}), frequentive of {{m|gml|matsken|matsken, matzgen|to cut, hew}}, from Proto-germanic {{m|gem-pro|*maitaną||to cut}}, from Proto-indo-european {{m|ine-pro|*mei-||small}}. Akin to Old high german (ca. 750-1050) {{m|goh|meizan||to cut}}, Dutch {{m|nl|matsen||to maul, kill}}, dialectal German {{m|de|metzgern||to butcher, kill}}, German {{m|de|metzgen||to cull, kill, slaughter cattle}}, {{m|de|Metzger||a butcher}}, {{m|de|Metzelei||massacre}}, Gothic {{m|got|𐌼𐌰𐌹𐍄𐌰𐌽||to cut}}. Alternatively, the Old French may have been derived from the verb {{m|fr|macacrer}}, {{m|fr|macacler}}, from a *\u0027matteuculāre\u0027, from *\u0027matteuca\u0027, from \u0027mattea\u0027. See also the modern French term {{m|fr|massacrer}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The intentional killing of a considerable number of human beings, under circumstances of atrocity or cruelty, or contrary to the norms of civilized people\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027massacre\u0027\u0027 on St. Bartholomew\u0027s Day\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"St. Valentine\u0027s Day\u0027\u0027 \u0027\u0027massacre\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Amritsar\u0027\u0027 \u0027\u0027massacre\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Murder\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1593\u0027\u0027, w:William William Shakespeare, \u0027The Tragedy of Richard the Third\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The tyrannous and bloody act is done\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The most arch deed of piteous \u0027\u0027massacre\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"That ever yet this land was guilty of\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"An overwhelming defeat\", \"priority\":10}]}, \"synonyms\":{}}");

