	add("massage", "{\"term\":\"massage\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"Arabic\", \"English\", \"French\"], \"text\":\"From French \u0027massage\u0027 from \u0027masser\u0027 (to massage) (borrowed around the end of the 18th century from Arabic {{m|ar|مَسَّ||feel, touch}}) + \u0027-age\u0027 Cognate to {{m|de|massieren}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The action of rubbing, kneading or hitting someone\u0027s body, to help the person relax, prepare for muscular action (as in contact sports) or to relieve aches\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Having a \u0027\u0027massage\u0027\u0027 can have many beneficial effects\", \"priority\":2}]}, \"synonyms\":{}}");

