	add("masses", "{\"term\":\"masses\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"People, especially a large number of peopl\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Since first tossing its cartoonish, good-time cock-rock to the \u0027\u0027masses\u0027\u0027 in the early ’00s, The Darkness has always fallen back on this defense: The band is a joke, but hey, it’s a good joke. With Hot Cakes—the group’s third album, and first since reforming last year—the laughter has died. In its place is the sad wheeze of the last surviving party balloon slowly, listlessly deflating\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The total population\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027masses\u0027\u0027 will be voting this Tuesday\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"lt;span style\u003d\u0026quot;font-variant:small-caps\u0026quot;\u0026gt;Dennis:\u0026lt;/span\u0026gt; Listen, strange women lyin\u0027 in ponds distributin\u0027 swords is no basis for a system of government. Supreme executive power derives from a mandate from the \u0027\u0027masses\u0027\u0027, not from some farcical aquatic ceremony\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The lower classes or all but the elite\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"the ignorant \u0027\u0027masses\", \"priority\":7}]}, \"synonyms\":{}}");

