	add("masterpiece", "{\"term\":\"masterpiece\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Dutch\"], \"text\":\"{{compound|master|piece|lang\u003den}}, a calque of Dutch \u0027meesterstuk\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A piece of work that has been given much critical praise, especially one that is considered the greatest work of a person\u0027s career\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1911\u0027\u0027, \u0027The Chronicles of Clovis\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The design, when finally developed, was a slight disappointment to Monsieur Deplis, who had suspected Icarus of being a fortress taken by Wallenstein in the Thirty Years\u0027 War, but he was more than satisfied with the execution of the work, which was acclaimed by all who had the privilege of seeing it as Pincini\u0027s \u0027\u0027masterpiece\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A work of outstanding creativity, skill or workmanship\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Masterpieces\u0027\u0027 are not completed, they are abandoned\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A work created in order to qualify as a master craftsman and member of a guild\", \"priority\":6}]}, \"synonyms\":{}}");

