	add("masterwort", "{\"term\":\"masterwort\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|master|wort|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an umbelliferous plant grown in gardens, formerly much used for medicinal purposes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1653\u0027\u0027, \u0027The English Physician Enlarged\u0027, Folio Society 2007, p. 184\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The root of \u0027\u0027Masterwort\u0027\u0027 is hotter than Pepper, and very available in all cold griefs and diseases both of stomach and body, dissolving very powerfully upward and downward\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"spp., such as the\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"ground elder, herb gerard, bishop\u0027s weed, goutweed, snow-in-the-mountain; also Englishmasterwort, wild masterwork\", \"priority\":5}]}, \"synonyms\":{}}");

	add("mastication", "{\"term\":\"mastication\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of chewing\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1918\u0027\u0027, Edgar Rice Burroughs, The Land That Time Forgot Chapter\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;It is more blasphemous than that thing which is swiping our meat,\u0026quot; I replied, for whatever the thing was, it had leaped upon our deer and was devouring it in great mouthfuls which it swallowed without \u0027\u0027mastication\u0027\u0027. The creature appeared to be a great lizard at least ten feet high, with a huge, powerful tail as long as its torso, mighty hind legs and short forelegs\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The process of crushing as though chewed\", \"priority\":4}]}, \"synonyms\":{}}");

