	add("mastupration", "{\"term\":\"mastupration\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"An alteration of \u0027\u0027 apparently to resemble or provide overtones of Latin \u0027manus\u0027 (hand) + \u0027stupro\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Masturbation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I.iii.2.4\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"it troubles me to think of, much more to relate, those frequent aborts and murdering of infants in their nunneries\u0026amp;nbsp;[…], those rapes, incests, adulteries, \u0027\u0027mastuprations\u0027\u0027, sodomies, buggeries of monks and friars\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, Anthony Burgess, \u0027Kingdom of the Wicked\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"She had caught him at the age of twelve in the act of \u0027\u0027mastupration\u0027\u0027. Unseemly, unroman, Greekish, Jewish. Well, in a sense he had done nothing but mastuprate since taking the purple\", \"priority\":5}]}, \"synonyms\":{}}");

	add("masturbation", "{\"term\":\"masturbation\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027masturbation\u0027 from Latin verb \u0027masturbor\u0027 conjectured to have originated from a contraction of \u0027manus\u0027 (hand) and {{m|la|turbō||disturb, throw into confusion}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Manual erotic stimulation of the genitals or other erotic regions, often to orgasm, either by oneself or a partner\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"II.12\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Diogenes\u0027 in sight of all, exercising his \u0027\u0027Masturbation\u0027\u0027, bred a longing desire in the bystanders, that in such sort they might fill their bellies by rubbing or clawing the same\", \"priority\":3}]}, \"synonyms\":{}}");

	add("masturbatrix", "{\"term\":\"masturbatrix\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|masturbate|rix|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A female masturbator\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1987\u0027\u0027, anonymous, \u0027Pleasure\u0027s Mistress\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Thus under the Restoration one spoke of the \u0027branleuses\u0027 or \u0027\u0027masturbatrixes\u0027\u0027 of the Palais Royal, whose clients, students for the most part, came to have their hard-ons massaged away for a few centimes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Michael Ford, \u0027Butch Boys: Stories for Men Who Need It Bad\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Beresford triumphs again with this intoxicating tale, filled with castle dungeons and tightly corseted ladies-in-waiting, naughty viscounts and impossibly cruel \u0027\u0027masturbatrixes\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Frank Sanello, \u0027Naked instinct: the unauthorized biography of Sharon Stone\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The actress wanted to stretch in a role that was 180 degrees away from the omnivorous Tramell and the \u0027\u0027masturbatrix\u0027\u0027 from Sutton\", \"priority\":7}]}, \"synonyms\":{}}");

